stá conservada; los hemisferios cerebrales son\nsimétricos.</span></font></li><li style="text-align: justify; margin-bottom: 0cm; line-height: 100%;"><span style="font-size: 12px;">\n</span><font style="font-size: 13pt; font-family: 'Times New Roman';"><span style="font-size: 12px;">Hay\nadecuada diferenciación y densidad entre sustancia gris y blanca. No\nobservo áreas que sugieran isquemia, hemorragia o masas.</span></font></li><li style="text-align: justify; margin-bottom: 0cm; line-height: 100%;"><span style="font-size: 12px;">\n</span><font style="font-size: 13pt; font-family: 'Times New Roman';"><span style="font-size: 12px;">Los\nganglios basales, los talamos, el mesencéfalo y el puente no\npresentan anormalidades.</span></font></li><li style="text-align: justify; margin-bottom: 0cm; line-height: 100%;"><span style="font-size: 12px;">\n</span><font style="font-size: 13pt; font-family: 'Times New Roman';"><span style="font-size: 12px;">La\nregión sellar, parasellar son normales.</span></font></li><li style="text-align: justify; margin-bottom: 0cm; line-height: 100%;"><span style="font-size: 12px;">\n</span><font style="font-size: 13pt; font-family: 'Times New Roman';"><span style="font-size: 12px;">No\nobservo lesiones ocupantes de espacio a nivel de los ángulos\npontocerebelosos.</span></font></li><li style="text-align: justify; margin-bottom: 0cm; line-height: 100%;"><span style="font-size: 12px;">\n</span><font style="font-size: 13pt; font-family: 'Times New Roman';"><span style="font-size: 12px;">Hay\ncalcificación fisiológica de glándula pineal y plexos coroideos.</span></font></li><li style="text-align: justify; margin-bottom: 0cm; line-height: 100%;"><span style="font-size: 12px;">\n</span><font style="font-size: 13pt; font-family: 'Times New Roman';"><span style="font-size: 12px;">La\nporción visualizada de los senos paranasales, las celdillas\nmastoideas y las órbitas son normales.</span></font></li></ul>	\n\t\n\t\n\t\n\n\n<p lang="es-MX" class="weste