ont face="Calibri, serif"><font size="3" style="font-size: 12pt">Los\nelementos de la fosa posterior están intactos.</font></font></p><p class="western" align="justify" style="margin-bottom: 0.35cm; line-height: 115%">\n<font face="Calibri, serif"><font size="3" style="font-size: 12pt">Plexos\ncoroideos y glándula pineal se aprecian de características normales\npara la edad. </font></font>\n</p><p class="western" align="justify" style="margin-bottom: 0.35cm; line-height: 115%">\n<font face="Calibri, serif"><font size="3" style="font-size: 12pt">La\nórbita y su contenido no muestran alteraciones. </font></font>\n</p><p class="western" align="justify" style="margin-bottom: 0.35cm; line-height: 115%">\n<font face="Calibri, serif"><font size="3" style="font-size: 12pt">Los\nsenos craneofaciales y pirámides petrosas bien neumatizados. </font></font>\n</p><p class="western" align="justify" style="margin-bottom: 0.35cm; line-height: 115%">\n<font face="Calibri, serif"><font size="3" style="font-size: 12pt">Estructuras\nóseas se observan de características normales. </font></font>\n</p><p class="western" align="justify" style="margin-bottom: 0.35cm; line-height: 115%">\n\t\n\t\n\t\n\n\n\n\n\n\n\n\n\n\n\n\n\n</p><p class="western" align="justify" style="margin-bottom: 0.35cm; line-height: 115%">\n<font face="Calibri, serif"><font style="font-size: 12pt">Tejidos\nblandos peri craneanos de características normales.&nbsp;</font></font>\n</p>	\n\t\n\t\n\t\n\n\n<ul>\n\t<li>\n<p style="margin-bottom: 0.35cm; line-height: 115%"><font face="Calibri, serif"><font style="font-size: 12pt"><i><b>ATROFIA\n\tCORTICAL LEVE.&nbsp;</b></i></font></font>\n\t</p>\n</li></ul>	Sin editar...			2016-01-18 10:43:29	\N	TC CEREBRAL SIN CONTRASTE	TC6787	89	30	t
