90	\N	56	89	3	138	\n\t\n\t\n\t\n\n\n<p lang="es-ES" class="western" align="justify" style="margin-bottom: 0cm; line-height: 100%">\n<span style="font-family: 'Times New Roman';"><font style="font-size: 14pt;"><span lang="es-MX" style="font-size: 12px;">Se\npractico tomografía computarizada con equipo helicoidal multicorte \ndel cráneo desde la base al vértice, sin la aplicación de material\nde contraste endovenoso evidenciando: </span></font><span style="font-size: 12px;">\n</span></span></p><span style="font-size: 12px;">\n</span><p lang="es-MX" class="western" align="justify" style="margin-bottom: 0cm; line-height: 100%"><span style="font-size: 12px;">\n</span><span style="font-family: 'Times New Roman';"><br><span style="font-size: 12px;">\n\n</span></span></p><span style="font-size: 12px;">\n</span><p lang="es-ES" class="western" align="justify" style="margin-bottom: 0cm; line-height: 100%"><span style="font-size: 12px;">\n</span><font style="font-size: 13pt; font-family: 'Times New Roman';"><span style="font-size: 12px;">La\ncalota craneana presenta fontanelas abiertas lo cual es\nfisiológicamente normal para su edad. Con múltiples eventos\nhemorrágicos dispersos en la región frontal, parieto-temporal y\noccipital bilatalmente con eventos isquémicos diseminados en el\nparénquima cerebral, compatible con Hipoxia cerebral. del recién\nnacido.</span></font></p><span style="font-size: 12px;">\n</span><p lang="es-ES" class="western" align="justify" style="margin-bottom: 0cm; line-height: 100%"><span style="font-size: 12px;">\n</span><font style="font-size: 13pt; font-family: 'Times New Roman';"><span style="font-size: 12px;">Los\nespacios subaracnoideos, los ventrículos, y las cisternas son de\namplitud normal.</span></font></p><span style="font-size: 12px;">\n</span><p lang="es-ES" class="western" align="justify" style="margin-bottom: 0cm; line-height: 100%"><span style="font-size: 12px;">\n</span><font style="font-size: 13pt; font-family: 'Times New Roman';"><span style="font-size: 12px;">No\ncolecciones epi o subdurales.</span></font></p><span style="font-size: 12px;">\n</span><p lang="es-ES" class="western" align="justify" style="margin-bottom: 0cm; line-height: 100%"><span style="font-size: 12px;">\n</span><font style="font-size: 13pt; font-family: 'Times New Roman';"><span style="font-size: 12px;">La\nlínea media está conservada; los hemisferios cerebrales son\nsimétricos. No hay evidencia de ventruculomegalia ni disgenesia del\ncuerpo calloso.</span></font></p><span style="font-size: 12px;">\n</span><p lang="es-ES" class="western" align="justify" style="margin-bottom: 0cm; line-height: 100%"><span style="font-size: 12px;">\n</span><font style="font-size: 13pt; font-family: 'Times New Roman';"><span style="font-size: 12px;">Hay\nadecuada diferenciación y densidad entre sustancia gris y blanca.\nLos ganglios basales, los talamos, el mesencéfalo y el puente no\npresentan anormalidades.</span></font></p><span style="font-size: 12px;">\n</span><p lang="es-ES" class="western" align="justify" style="margin-bottom: 0cm; line-height: 100%"><span style="font-size: 12px;">\n</span><font style="font-size: 13pt; font-family: 'Times New Roman';"><span style="font-size: 12px;">La\nregión sellar, para sellar son normales.</span></font></p><span style="font-size: 12px;">\n</span><p lang="es-ES" class="western" align="justify" style="margin-bottom: 0cm; line-height: 100%"><span style="font-size: 12px;">\n</span><font style="font-size: 13pt; font-family: 'Times New Roman';"><span style="font-size: 12px;">No\nobservo lesiones ocupantes de espacio a nivel de los ángulos\npontocerebelosos.</span></font></p><span style="font-size: 12px;">\n</span><p lang="es-ES" class="western" align="justify" style="margin-bottom: 0cm; line-height: 100%"><span style="font-size: 12px;">\n</span><font style="font-size: 13pt; font-family: 'Times New Roman';"><span style="font-size: 12px;">Senos\npara nasales y  las órbitas son normales.es recomendable control con\nnuevo Tac cerebral en 4 semanas</span></font></p>	\n\t\n\t\n\t\n\n\n<p lang="es-ES" class="western" align="justify" style="margin-left: 3.81cm; text-indent: -3.81cm; margin-bottom: 0cm; line-height: 100%">\n<font style="font-size: 14pt;"><span lang="es-MX" style="font-family: 'Times New Roman'; font-size: 12px;"><b>HIPOXIA\nCEREBRAL DEL RECIEN NACIDO</b></span></font></p>	2016-02-09 18:56:58	\N	\N			\N	<ul><li>designar una enfermera permanente</li><li>beber liquidos en exceso</li></ul>	87	2016-02-09 18:56:58	68
