font-family: sans-serif; line-height: 22.3999996185303px; text-align: left; background-image: none; background-color: rgb(255, 255, 255); background-position: initial;">ciencia fic</a></li><li style="text-align: justify;"><a href="https://es.wikipedia.org/wiki/Ciencia_ficci%C3%B3n" title="Ciencia ficción" style="color: rgb(11, 0, 128); font-family: sans-serif; line-height: 22.3999996185303px; text-align: left; background-image: none; background-color: rgb(255, 255, 255); background-position: initial;">ción</a><span style="font-family: sans-serif; line-height: 22.3999996185303px; text-align: left;">&nbsp;que fundó&nbsp;</span><a href="https://es.wikipedia.org/w/index.php?title=Fiction_House&amp;action=edit&amp;redlink=1" class="new" title="Fiction House (aún no redactado)" style="color: rgb(165, 88, 88); font-family: sans-serif; line-height: 22.3999996185303px; text-align: left; background-image: none; background-color: rgb(255, 255, 255); background-position: initial;">Fiction House</a><span style="font-family: sans-serif; line-height: 22.3999996185303px; text-align: left;">&nbsp;en 1939. Se publicó desde 1939 hasta 1955 con un total de 71 números. El control editorial</span></li><li><ul><li style="text-align: justify;"><span style="font-family: sans-serif; line-height: 22.3999996185303px; text-align: left;">estuvo siempre en manos de&nbsp;</span><a href="https://es.wikipedia.org/w/index.php?title=Malcolm_Reiss&amp;action=edit&amp;redlink=1" class="new" title="Malcolm Reiss (aún no redactado)" style="color: rgb(165, 88, 88); font-family: sans-serif; line-height: 22.3999996185303px; text-align: left; background-image: none; background-color: rgb(255, 255, 255); background-position: initial;">Malcolm Reiss</a><span style="font-family: sans-serif; line-height: 22.3999996185303px; text-align: left;">, primero como editor y luego, desde el número impreso en otoño de 1942, como jefe de redacción cuando pasó a delegar sus labores editoriales a una serie de subeditores: el 